import React, { useState } from 'react';
import { useZxing } from 'react-zxing';
import { useNavigate } from 'react-router-dom';
import './qrS.css';

const Qr = () => {
  const [result, setResult] = useState('');
  const { ref } = useZxing({
    onResult(result) {
      setResult(result.getText());
    },
  });

  const navigate = useNavigate();

  const navigateToDynamicPage = () => {
    if (result === 'well') {
      navigate('/dynamic-page'); // Replace '/dynamic-page' with the actual route for the dynamic page
    } else {
      alert(`The page '${result}' does not exist or does not match any records in the database.`);
    }
  };

  return (
    <>
      <div className='vidcen'>
        <video ref={ref} className="vid" />
        <div className="scanner-frame"></div>
      </div>

      <p>
        <span>Last result:</span>
        <span>{result}</span>
      </p>

      <button onClick={navigateToDynamicPage}>Go to Dynamic Page</button>
    </>
  );
};

export default Qr
